import './App.css';
import React from "react";
import SomeInformation from "./components/SomeInformation.js";
import DayPlan from "./components/DayPlan.js";
import Person from "./components/Person.js";
import TextAndDateInformation from "./components/TextAndDateInformation.js";
import {Route, BrowserRouter as Router, Link, Routes} from "react-router-dom";

function App() {
    return (

        <Router>
            <Routes> {/* Обертываем все Route внутри Routes */}
                <Route path="/" element={<SomeInformation />} />
                <Route path="/text-and-date" element={<TextAndDateInformation />} />
                <Route path="/day-plan" element={<DayPlan />} />
                <Route path="/person" element={<Person />} />
            </Routes>
        </Router>

    );
}

export default App;
